import React from 'react'
import Product from '../Product/Product'
import './FP.css'
import { AllProd } from '../../products'

const FeaturedProduct = () => {
  return (
      <main className="feat-prod-items">
        {AllProd.map((product)=>(
            <div key={product.id}>
                <Product product = {product}/>
            </div>
        ))}
      </main>
  )
}

export default FeaturedProduct
